function content(c, mapid) {
    var a = c.getInventory(MapleInventoryType.EQUIPPED).getItem(-11);
    if (a == null || a.getItemId() != 1432039) { //判断有没有装备钓鱼竿
        return false;
    }
    if (getItemAmount(c, 2300001) && getItemAmount(c, 5220002) && getItemAmount(c, 3011000)) {
        if (mapid != 749050500) { //比赛图.
            if (getItemAmount(c, 2300001)) {
                //高级鱼
                addItem(c, 1);
            } else {
                //普通鱼
                addItem(c, 0);
            }
        } else {
            gainItem(c, (getItemAmount(c, 2300001) == 0) ? 2300000 : 2300001, -1);
            //c.getClient().getSession().write(MaplePacketCreator.serverNotice(5, "消耗了一个高级鱼饵.没有钓到任何东西."));
            c.dropMessage(-1, "消耗了一个鱼饵.没有钓到任何东西.");

        }
        ChanceItemDrop(c); //一定几率获得其他物品
    } else {
        c.getClient().getSession().write(MaplePacketCreator.serverNotice(5, "高级双倍钓鱼场必须要有高级鱼饵、双倍爆率钓鱼卡、钓鱼竿、钓鱼专用椅才能钓鱼."));

    }
    return true;
}
