function ChanceItemDrop(player) {
    var itemid = Math.floor(Math.random() * fish.length);
    var randNum = Math.floor(Math.random() * 400) + 1;  //550
    var a = weapon_quality[Math.floor(Math.random() * weapon_quality.length)];
    var b = weapon[Math.floor(Math.random() * weapon.length)];
    if (randNum < 3) {
        //带属性物品
        gainItem_specail(player, a[0], 1, Math.floor((Math.random() * a[1])));
        player.dropMessage(-1, "你钓到了100-8000属性极品装备.");
        em.broadcastServerMsg(5121014, "" + player.getName() + "在高级双倍钓鱼场钓出了100-8000属性极品装备。", true);


    } else if (randNum >= 4 && randNum <= 100) {
        //不带属性物品
        gainItem_specail(player, b, 1, 0);
        //player.getClient().getSession().write(MaplePacketCreator.serverNotice(5, "你钓到了东西."));
//em.startFishing(player, fish);
        player.dropMessage(-1, "你钓到了东西.");
        //em.startFishing(player,  b,500,400,100,50,1,1000*5,100,1);
    }
    return true;
}

