function addItem(c, choose) { //增加鱼
    var randNum = Math.floor(Math.random() * 1000) + 1;
    if (choose) { //高级鱼饵能钓到更多的鱼.
        randNum -= 200;
    }
    if (fish.length > 0) {
        var itemid = Math.floor(Math.random() * fish.length);
        if (fish[itemid][1] < randNum) {
            //c.getClient().getSession().write(MaplePacketCreator.serverNotice(5, "消耗了一个鱼饵.但是没有钓到任何东西."));
            c.dropMessage(-1, "消耗了一个鱼饵.但是没有钓到任何东西.");
            gainItem(c, (getItemAmount(c, 2300001) == 0) ? 2300000 : 2300001, -1);
            return;
        }
        //gainItem(c,fish[itemid][0],1);
        //c.getClient().getSession().write(net.sf.odinms.tools.MaplePacketCreator.serverNotice(5, c.getName()+" : "+"钓上了一条鱼."+randNum)); 
        //c.getClient().getSession().write(MaplePacketCreator.serverNotice(5, "消耗了一个鱼饵.但是没有钓到任何东西."));
        c.dropMessage(-1, "消耗了一个鱼饵.但是没有钓到任何东西.");
        //c.getClient().getSession().write(net.sf.odinms.tools.MaplePacketCreator.serverNotice(3, c.getName()+" : "+"success！.")); 
    }
    gainItem(c, (getItemAmount(c, 2300001) == 0) ? 2300000 : 2300001, -1);
    //c.getClient().getSession().write(MaplePacketCreator.serverNotice(5, "消耗了一个鱼饵.但是没有钓到任何东西."));
    c.dropMessage(-1, "消耗了一个鱼饵.但是没有钓到任何东西.");
}

function gainItem_specail(player, itemid, quantity, quality) { //获得物品函数。可以带属性
    var c = player.getClient();

    if (quantity > 0) {
        if (!MapleInventoryManipulator.checkSpace(c, itemid, quantity, "")) {
            c.getSession().write(MaplePacketCreator.serverNotice(1, "你的背包已满"));
            return;
        }
        var ii = MapleItemInformationProvider.getInstance();
        var type = GameConstants.getInventoryType(itemid);
        if (type.equals(MapleInventoryType.EQUIP)) {
            var item = ii.randomizeStats(ii.getEquipById(itemid)).copy();
            if (quality != null && !ii.isThrowingStar(item.getItemId()) && !ii.isBullet(item.getItemId())) {
                //item.setLocked(1);
                item.setLevel(0);
                item.setStr(quality);
                item.setDex(quality);
                item.setInt(quality);
                item.setLuk(quality);
                item.setHp(quality / 5);
                item.setMp(quality / 5);
                item.setMatk(quality / 1.2);
                item.setWatk(quality / 1.2);
            }
            MapleInventoryManipulator.addFromDrop(c, item, false); //如果是装备用这个
        } else {
            //var item = new Item(itemid,0,0,0,-1);
            MapleInventoryManipulator.addById(c, itemid, quantity, "钓鱼场"); //如果是其他物品
        }

        // if (quality != null) {

        // if(type.equals(MapleInventoryType.EQUIP)){
        // var msg = player.getName() + " : " + "(" + quality + "属性)从钓鱼场中钓得,大家恭喜恭喜！";
        // c.getChannelServer().broadcastPacket(MaplePacketCreator.itemMegaphone(msg, true, c.getChannel(), item));
        // }else{
        // var msg = player.getName() + " : " + "从钓鱼场中钓得,大家恭喜恭喜！";
        // c.getChannelServer().broadcastPacket(MaplePacketCreator.itemMegaphone(msg, true, c.getChannel(), item));
        // }
        // }
    } else {
        MapleInventoryManipulator.removeById(c, MapleItemInformationProvider.getInstance().getInventoryType(itemid), itemid, -quantity, true, false);
    }
    c.getSession().write(MaplePacketCreator.getShowItemGain(itemid, quantity, true));
    //c.getSession().write(MaplePacketCreator.gainGachaponItem(itemId, quantity, "转蛋机", notice));
}

function gainItem(player, itemid, quantity) { //获得物品函数--针对其他栏位无法识别类
    var c = player.getClient();
    if (quantity > 0) {
        //MapleInventoryManipulator.addById(c, itemid, quantity, "");
        var ii = MapleItemInformationProvider.getInstance();
        var item = ii.getEquipById(itemid);
        //var type = ii.getInventoryType(itemid);
        var type = GameConstants.getInventoryType(itemid);
        if (!MapleInventoryManipulator.checkSpace(c, itemid, quantity, "")) {
            var invtype = GameConstants.getInventoryType(itemid);
            c.getSession().write(MaplePacketCreator.serverNotice(1, "你的背包已满"));
            return;
        }
        MapleInventoryManipulator.addFromDrop(c, item, false);
    } else {
        MapleInventoryManipulator.removeById(c, GameConstants.getInventoryType(itemid), itemid, -quantity, true, false);
    }
    c.getSession().write(MaplePacketCreator.getShowItemGain(itemid, quantity, true));
}